import React from "react";
import "./Tests.css";

const Tests = () => {
  return (
    <div className="page tests">
      <h2>Проверьте свои знания</h2>
      <p>Здесь будут тесты для проверки вашего уровня английского.</p>
    </div>
  );
};

export default Tests;
